import React from 'react';

const HomePage = () => {
  return (
    <div style={{
      minHeight: 'calc(100vh - 70px)',
      background: 'linear-gradient(45deg, #dd3885ff 0%, #1a0000 100%)',
      padding: '50px 20px',
      textAlign: 'center',
      color: 'white'
    }}>
      <h1 style={{ 
        fontSize: '48px', 
        color: '#f30808c5',
        marginBottom: '20px'
      }}>
        üî• –¢–ï–•–ù–ò–ß–ï–°–ö–ò–ô –°–ü–ï–¶–ò–ê–õ–ò–°–¢
      </h1>
      
      <p style={{ 
        fontSize: '24px', 
        maxWidth: '800px',
        margin: '0 auto 40px',
        lineHeight: '1.6'
      }}>
        –¢–µ—Ö-–ª–∏–¥ / Digital-—Ç–µ—Ö–Ω–æ–ª–æ–≥ <br/>
        –ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã ‚Ä¢ –ß–∞—Ç-–±–æ—Ç—ã ‚Ä¢ –ö–æ–º–ø–ª–µ–∫—Å–Ω—ã–µ –∑–∞–ø—É—Å–∫–∏
      </p>
      
      <div style={{ 
        display: 'flex', 
        justifyContent: 'center', 
        gap: '20px',
        flexWrap: 'wrap'
      }}>
        {['ü§ñ –ß–∞—Ç-–±–æ—Ç—ã', 'üé• –ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã', 'üöÄ –ó–∞–ø—É—Å–∫–∏', 'üíª –¢–µ—Ö–ø–æ–¥–¥–µ—Ä–∂–∫–∞'].map((item, index) => (
          <div
            key={index}
            style={{
              background: 'rgba(201, 183, 183, 0.1)',
              border: '1px solid #ff0000',
              padding: '15px 30px',
              borderRadius: '10px',
              fontSize: '18px',
              cursor: 'pointer',
              transition: 'all 0.3s'
            }}
            onMouseEnter={(e) => e.currentTarget.style.background = 'rgba(255, 0, 0, 0.2)'}
            onMouseLeave={(e) => e.currentTarget.style.background = 'rgba(255, 0, 0, 0.1)'}
          >
            {item}
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomePage;
